export default function Recipe() {
    const location = useLocation()
    const { recipe } = location.state
    const [value, setValue] = React.useState(recipe.servings);
    const handleChange = value => setValue(value);


    return (
        <LandingLayout>
            <Container maxW={'7xl'}>
                <SimpleGrid
                    columns={{ base: 1, lg: 2 }}
                    spacing={{ base: 8, md: 10 }}
                    pt={{ base: 9, md: 12 }}
                    pb={{ base: 18, md: 24 }}>
                <Flex>
                        <Image
                            rounded={'md'}
                            src={'../'+recipe.image}
                            fit={'cover'}
                            align={'center'}
                            w={'100%'}
                            h={{ base: '100%', sm: '400px', lg: '500px' }}
                        />
                    </Flex>
                    <Stack spacing={{ base: 6, md: 10 }}>
                        <Box as={'header'}>
                            <Heading
                                lineHeight={1.1}
                                fontWeight={600}
                                fontSize={{ base: '2xl', sm: '4xl', lg: '5xl' }}>
                                {recipe.name}
                            </Heading>
                        </Box>

                        <Stack
                            spacing={{ base: 4, sm: 6 }}
                            direction={'column'}
                            divider={
                                <StackDivider
                                    borderColor={useColorModeValue('gray.200', 'gray.600')}
                                />
                            }>
                            <VStack spacing={{ base: 4, sm: 6 }}>
                                <Text
                                    color={useColorModeValue('gray.500', 'gray.400')}
                                    fontSize={'2xl'}
                                    fontWeight={'300'}>
                                    Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed
                                    diam nonumy eirmod tempor invidunt ut labore
                                </Text>
                                <SimpleGrid columns={{ base: 1, md: 4 }} spacing={10}>
                                    <Feature
                                        icon={<Icon as={UpDown2Icon} w={10} h={10} />}
                                        title={'Porciones'}
                                        text={
                                            <NumberInput size='sm' maxW={20} defaultValue={recipe.servings} min={1} onChange={handleChange}>
                                                <NumberInputField />
                                                <NumberInputStepper>
                                                    <NumberIncrementStepper />
                                                    <NumberDecrementStepper />
                                                </NumberInputStepper>
                                            </NumberInput>
                                        }
                                    />
                                    <Feature
                                        icon={<Icon as={UpDownIcon} w={10} h={10} />}
                                        title={'Prep time'}
                                        text={recipe.prepTime + ' min'}
                                    />
                                    <Feature
                                        icon={<Icon as={UpDown4Icon} w={10} h={10} />}
                                        title={'Cook time'}
                                        text={recipe.cookTime + ' min'}
                                    />
                                    <Feature
                                        icon={<Icon as={UpDown3Icon} w={10} h={10} />}
                                        title={'Total time'}
                                        text={recipe.totalTime + ' min'}
                                    />
                                </SimpleGrid>
                            </VStack>
                            <Box>
                                <Text
                                    fontSize={{ base: '16px', lg: '18px' }}
                                    color={useColorModeValue('yellow.500', 'yellow.300')}
                                    fontWeight={'500'}
                                    textTransform={'uppercase'}
                                    mb={'4'}>
                                    Ingredientes
                                </Text>
                                <SimpleGrid columns={{ base: 1, md: 1 }} spacing={10}>
                                    <List spacing={2}>
                                        {
                                            recipe.ingredients.map(item => {
                                                return (
                                                    <ListItem> {value*item.quantity/recipe.servings} {item.unit} {item.name}</ListItem>
                                                )
                                            })
                                        }
                                    </List>
                                </SimpleGrid>
                            </Box>
                            <Box>
                                <Text
                                    fontSize={{ base: '16px', lg: '18px' }}
                                    color={useColorModeValue('yellow.500', 'yellow.300')}
                                    fontWeight={'500'}
                                    textTransform={'uppercase'}
                                    mb={'4'}>
                                    Instrucciones
                                </Text>
                                <List spacing={2}>
                                    {
                                        recipe.directions.map((item, index) => {
                                            return (
                                                <ListItem>
                                                    <Text as={'span'} fontWeight={'bold'}>{index+1}:</Text>{' '}
                                                    {item}{' '}
                                                </ListItem>
                                            )
                                        })
                                    }
                                </List>

                            </Box>
                        </Stack>
                        </Stack>
                </SimpleGrid>
            </Container>
        </LandingLayout>
    );
}
